import ExpenseItem from "./expenseItem";
import Card from "./card";
import "./expenseItemsRender.css";
function ex(props) {
  let markup;
  for (let i = 0; i < 4; i++) {
    markup += (
      <ExpenseItem
        title={props.expenses[i].title}
        amount={props.expenses[i].amount}
        date={props.expenses[i].date}
      ></ExpenseItem>
    );
  }
  return markup;
}
function ExpenseItemsRender(props) {
  return <Card className="expenses">{ex(props)}</Card>;
}
export default ExpenseItemsRender;
